const Item = (props) => {
	const v = props.details;
	return (<>
		<div className="bg-red-100 rounded-xl my-5 p-3 flex flex-row">
			<div className="flex-1">
				<div className="w-full">
					<img src={v.img} alt={v.name} />
				</div>
			</div>
			<div className="flex-1 flex flex-col">
				<h1 className="text-red-500">{v.name}</h1>
			</div>
		</div>
	</>);
}
 
export default Item;
